import React, { useState } from "react";
import { Person } from "../types/personType";

const AddToList = () => {
  const [person, setPerson] = useState<Person>({
    name: "",
    age: 0,
    note: "",
    url: "",
  });

  return (
    <div className="addto-list">
      <input
        type="text"
        placeholder="Name"
        className="addto-list-input"
        value={person.name}
      />
      <input
        type="text"
        placeholder="Age"
        className="addto-list-input"
        value={person.age}
      />
      <input
        type="text"
        placeholder="Image URL"
        className="addto-list-input"
        value={person.url}
      />
      <textarea placeholder="Notes" value={person.note}></textarea>
    </div>
  );
};

export default AddToList;
